sfField.formula:
/*** Cases are sorted by the oldest, highest Priority first. ***/
/*** The name of the file determines the sort order by Priority on the list view. ***/
/*** You MUST make sure the Highest Priority image has the lowest name alphabetically ***/

CASE( Priority,
"Low", IMAGE("/resource/casePriorityImages/20-Low_Priority.png", "") & " Low",
"Medium", IMAGE("/resource/casePriorityImages/15-Medium_Priority.png", "") & " Medium",
"High", IMAGE("/resource/casePriorityImages/10-High_Priority.png", "") & " High",
"Critical", IMAGE("/resource/casePriorityImages/05-Critical_Priority.png", "") & " High",
"Sales", IMAGE("/resource/casePriorityImages/00-Sales_Priority.png", "") & " High",
IMAGE("/s.gif", "") & " " & TEXT(Priority)
)
